import React from 'react';
import {fbAuth} from '../fbase';

const Profile = () => {
  const onLogOutClick = () => fbAuth.signOut;
  return (
    <>
      <span>Profile</span>
      <button>Log Out</button>
    </>
  );
};
export default Profile;
